var fileJSON=[{"path":"/home/u119070/cgo/elastic-sycl-hls/experiments/bfs_bram.cpp", "name":"bfs_bram.cpp", "has_active_debug_locs":false, "absName":"/home/u119070/cgo/elastic-sycl-hls/experiments/bfs_bram.cpp", "content":"#include <algorithm>\u000A#include <iostream>\u000A#include <limits>\u000A#include <map>\u000A#include <math.h>\u000A#include <numeric>\u000A#include <queue>\u000A#include <random>\u000A#include <stdlib.h>\u000A#include <sycl/ext/intel/fpga_extensions.hpp>\u000A#include <sycl/sycl.hpp>\u000A#include <vector>\u000A\u000A#include \"exception_handler.hpp\"\u000A\u000A#include \"memory_utils.hpp\"\u000A\u000Ausing namespace sycl;\u000A\u000Aconstexpr int MAX_VERTICES = 2000;\u000A\u000A// Forward declare kernel name.\u000Aclass MainKernel;\u000A\u000Adouble kernel_fpga(queue &q, std::vector<int> &h_adjList,\u000A                   std::vector<int> &h_numNeighbours,\u000A                   std::vector<int> &h_visited, int numVertices,\u000A                   int startNode) {\u000A  int *adjList = fpga_tools::toDevice(h_adjList, q);\u000A  int *numNeighbours = fpga_tools::toDevice(h_numNeighbours, q);\u000A  int *visited_dram = fpga_tools::toDevice(h_visited, q);\u000A\u000A\u000A  using CurrentNodePopPipe = pipe<class _CurrentNodePopPipe, int, 32>;\u000A  using CurrentNodePushPipe = pipe<class _CurrentNodePushPipe, int, 32>;\u000A\u000A  using QueueIsEmptyPipe = pipe<class _QueueIsEmptyPipe, bool, 16>;\u000A\u000A  auto queueEvent = q.single_task<class QueueKernel>([=]() [[intel::kernel_args_restrict]] {\u000A    // Create a queue for bc\u000A    int queue[MAX_VERTICES];\u000A    int front = 0, rear = 0;\u000A    queue[rear++] = startNode;\u000A\u000A    [[intel::ivdep]]\u000A    while (true) {\u000A      // Dequeue a vertex from queue and print it\u000A      if (front < rear) {\u000A        int currentNode = queue[front];\u000A        bool succ = false;\u000A        CurrentNodePopPipe::write(currentNode, succ);\u000A        if (succ) {\u000A          front++;\u000A        }\u000A      }\u000A\u000A      bool succ2 = false;\u000A      int nextNode = CurrentNodePushPipe::read(succ2);\u000A      if (succ2) {\u000A        queue[rear++] = nextNode;\u000A        // PRINTF(\"New push node %d\\n\", nextNode);\u000A      } \u000A\u000A      if (rear == front) {\u000A        bool succ3 = false;\u000A        QueueIsEmptyPipe::read(succ3);\u000A        // if (front == rear && succ3)\u000A        if (succ3)\u000A          break;\u000A      }\u000A    }\u000A\u000A    // PRINTF(\"EXITING QUEUE KERNEL\\nDONE %d NODES\\n\", front);\u000A    // Sentinel value.\u000A    CurrentNodePopPipe::write(-1);\u000A  });\u000A\u000A  auto event = q.single_task<MainKernel>([=]() [[intel::kernel_args_restrict]] {\u000A    [[intel::singlepump]] \u000A    [[intel::max_replicates(1)]] \u000A    [[intel::numbanks(1)]] \u000A    bool visited[MAX_VERTICES];\u000A    visited[startNode] = true;\u000A\u000A    int qsize = 1;\u000A    while (true) {\u000A      int currentNode = CurrentNodePopPipe::read();\u000A      qsize--;\u000A      if (currentNode == -1)\u000A        break;\u000A\u000A      int pushedCount = 0;\u000A      for (int i = 0; i < numNeighbours[currentNode]; ++i) {\u000A        int neighbor = adjList[currentNode * numVertices + i];\u000A        if (!visited[neighbor]) {\u000A          visited[neighbor] = 1;\u000A          CurrentNodePushPipe::write(neighbor);\u000A          pushedCount++;\u000A        }\u000A      }\u000A      qsize += pushedCount;\u000A\u000A      if (qsize == 0)\u000A        QueueIsEmptyPipe::write(1);\u000A    }\u000A\u000A    for (int i = 0; i < numVertices; ++i)\u000A      visited_dram[i] = int(visited[i]);\u000A  });\u000A\u000A  event.wait();\u000A  queueEvent.wait();\u000A\u000A  q.copy(visited_dram, h_visited.data(), h_visited.size()).wait();\u000A  sycl::free(adjList, q);\u000A  sycl::free(numNeighbours, q);\u000A  sycl::free(visited_dram, q);\u000A\u000A  auto start = event.get_profiling_info<info::event_profiling::command_start>();\u000A  auto end = event.get_profiling_info<info::event_profiling::command_end>();\u000A  double time_in_ms = static_cast<double>(end - start) / 1000000;\u000A  return time_in_ms;\u000A}\u000A\u000A// Function to perform Breadth First Search on a graph\u000A// represented using adjacency list\u000Avoid bfs_cpu(std::vector<int> &adjList, std::vector<int> &numNeighbours,\u000A             std::vector<int> &visited, int numVertices, int startNode) {\u000A  // Create a queue for BFS\u000A  std::queue<int> q;\u000A\u000A  // Mark the current node as visited and enqueue it\u000A  visited[startNode] = 1;\u000A  q.push(startNode);\u000A\u000A  // Iterate over the queue\u000A  while (!q.empty()) {\u000A    // Dequeue a vertex from queue and print it\u000A    int currentNode = q.front();\u000A    q.pop();\u000A\u000A    // Get all adjacent vertices of the dequeued vertex\u000A    // currentNode If an adjacent has not been visited,\u000A    // then mark it visited and enqueue it\u000A    // for (int neighbor : adjList[currentNode]) {\u000A    for (int i = 0; i < numNeighbours[currentNode]; ++i) {\u000A      int neighbor = adjList[currentNode * numVertices + i];\u000A      if (visited[neighbor] == 0) {\u000A        visited[neighbor] = 1;\u000A        q.push(neighbor);\u000A      }\u000A    }\u000A  }\u000A}\u000A\u000A// Function to add an edge to the graph\u000Avoid addEdge(int u, int v, std::vector<int> &adjList,\u000A             std::vector<int> &numNeighbours, int numVertices) {\u000A  adjList[u * numVertices + numNeighbours[u]] = v;\u000A  numNeighbours[u]++;\u000A}\u000A\u000A\u000Aint main(int argc, char *argv[]) {\u000A  FILE *fp;\u000A  try {\u000A    if (argc < 2) {\u000A      throw std::invalid_argument(\"Need graph filename.\");\u000A    }\u000A\u000A    char *filename = argv[1];\u000A    if ((fp = fopen(filename, \"r\")) == NULL) {\u000A      throw std::invalid_argument(\"Invalid filename.\");\u000A    }\u000A  } catch (exception const &e) {\u000A    std::cout << \"Incorrect argv.\\nUsage: ./executable [maxIters]\\n\";\u000A    std::terminate();\u000A  }\u000A\u000A#if FPGA_SIM\u000A  auto d_selector = sycl::ext::intel::fpga_simulator_selector_v;\u000A#elif FPGA_HW\u000A  auto d_selector = sycl::ext::intel::fpga_selector_v;\u000A#else\u000A  auto d_selector = sycl::ext::intel::fpga_emulator_selector_v;\u000A#endif\u000A  try {\u000A  ////////////////////////////////////////////////////////////////////////////\u000A  ////// Read graph\u000A  ////////////////////////////////////////////////////////////////////////////\u000A  int numVertices = 0, numEdges = 0;\u000A\u000A  // Read the data set and get the number of nodes (n) and edges (e)\u000A  // int n, e;\u000A  char str[1000];\u000A  char ch = getc(fp);\u000A  while (ch == '#') {\u000A    fgets(str, 1000 - 1, fp);\u000A    // Debug: print title of the data set\u000A    // printf(\"%s\",str);\u000A    sscanf(str, \"%*s %d %*s %d\", &numVertices, &numEdges); // number of nodes\u000A    ch = getc(fp);\u000A  }\u000A  ungetc(ch, fp);\u000A\u000A  // DEBUG: Print the number of nodes and edges, skip everything else\u000A  printf(\"\\nGraph data: Nodes: %d, Edges: %d \\n\\n\", numVertices, numEdges);\u000A\u000A  // Adjacency list representation of the graph\u000A  std::vector<int> adjList(numVertices * numVertices, -1);\u000A  std::vector<int> numNeighbours(numVertices, 0);\u000A\u000A  int fromNode, toNode;\u000A  int nextNormalizedVertexId = 0;\u000A  std::map<int, int> normalizedVertedId;\u000A  while (!feof(fp)) {\u000A    fscanf(fp, \"%d%*s%d\", &fromNode, &toNode);\u000A\u000A    if (normalizedVertedId.find(fromNode) == normalizedVertedId.end()) \u000A      normalizedVertedId[fromNode] = nextNormalizedVertexId++;\u000A    if (normalizedVertedId.find(toNode) == normalizedVertedId.end()) \u000A      normalizedVertedId[toNode] = nextNormalizedVertexId++;\u000A\u000A    addEdge(normalizedVertedId[fromNode], normalizedVertedId[toNode], adjList,\u000A            numNeighbours, numVertices);\u000A  }\u000A  ////////////////////////////////////////////////////////////////////////////\u000A  ////// END Read graph\u000A  ////////////////////////////////////////////////////////////////////////////\u000A\u000A  // Mark all the vertices as not visited\u000A  std::vector<int> visited(numVertices, 0);\u000A  std::vector<int> visited_cpu(numVertices, 0);\u000A\u000A  property_list properties{property::queue::enable_profiling()};\u000A  queue q(d_selector, exception_handler, properties);\u000A  std::cout << \"Running on device: \"\u000A            << q.get_device().get_info<info::device::name>() << \"\\n\";\u000A\u000A  // Perform BFS traversal starting from vertex 0\u000A  bfs_cpu(adjList, numNeighbours, visited_cpu, numVertices, 0);\u000A  auto kernelTime =\u000A      kernel_fpga(q, adjList, numNeighbours, visited, numVertices, 0);\u000A\u000A  std::cout << \"\\nKernel time (ms): \" << kernelTime << \"\\n\";\u000A\u000A  if (std::equal(visited.begin(), visited.end(), visited_cpu.begin())) {\u000A    std::cout << \"Passed\\n\";\u000A    } else {\u000A      std::cout << \"Failed\\n\";\u000A    }\u000A\u000A  } catch (exception const &e) {\u000A    std::cout << \"An exception was caught.\\n\";\u000A    std::terminate();\u000A  }\u000A  \u000A  return 0;\u000A}\u000A"}, {"path":"/home/u119070/cgo/elastic-sycl-hls/include_sycl/exception_handler.hpp", "name":"exception_handler.hpp", "has_active_debug_locs":false, "absName":"/home/u119070/cgo/elastic-sycl-hls/include_sycl/exception_handler.hpp", "content":"#ifndef __EXCEPTIONHANDLER_HPP__\u000A#define __EXCEPTIONHANDLER_HPP__\u000A#include <sycl/sycl.hpp>\u000A#include <exception>\u000A#include <iostream>\u000A\u000Avoid exception_handler(sycl::exception_list exceptions) {\u000A  for (std::exception_ptr const &e : exceptions) {\u000A    try {\u000A      std::rethrow_exception(e);\u000A    } catch (sycl::exception const &e) {\u000A      std::cout << \"Caught asynchronous SYCL exception:\\n\"\u000A                << e.what() << std::endl;\u000A    }\u000A  }\u000A}\u000A\u000A\u000A#endif //__EXCEPTIONHANDLER_HPP__\u000A"}, {"path":"/home/u119070/cgo/elastic-sycl-hls/include_sycl/memory_utils.hpp", "name":"memory_utils.hpp", "has_active_debug_locs":false, "absName":"/home/u119070/cgo/elastic-sycl-hls/include_sycl/memory_utils.hpp", "content":"#ifndef __MEMORY_UTILS_HPP__\u000A#define __MEMORY_UTILS_HPP__\u000A\u000A#include <type_traits>\u000A\u000A#include <sycl/ext/intel/fpga_extensions.hpp>\u000A#include <sycl/sycl.hpp>\u000A\u000A#include \"metaprogramming_utils.hpp\"\u000A\u000A//\u000A// The utilities in this file are used for converting streaming data to/from\u000A// memory from/to a pipe.\u000A//\u000A\u000Anamespace fpga_tools {\u000A\u000Anamespace detail {\u000A\u000A//\u000A// Helper to check if a SYCL pipe and pointer have the same base type\u000A//\u000Atemplate <typename PipeT, typename PtrT>\u000Astruct pipe_and_pointer_have_same_base {\u000A  using PipeBaseT =\u000A      std::conditional_t<fpga_tools::has_subscript_v<PipeT>,\u000A                         std::decay_t<decltype(std::declval<PipeT>()[0])>,\u000A                         PipeT>;\u000A  using PtrBaseT = std::decay_t<decltype(std::declval<PtrT>()[0])>;\u000A  static constexpr bool value = std::is_same_v<PipeBaseT, PtrBaseT>;\u000A};\u000A\u000Atemplate <typename PipeT, typename PtrT>\u000Ainline constexpr bool pipe_and_pointer_have_same_base_v =\u000A    pipe_and_pointer_have_same_base<PipeT, PtrT>::value;\u000A\u000A//\u000A// Streams data from 'in_ptr' into 'Pipe', 'elements_per_cycle' elements at a\u000A// time\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, typename PtrT>\u000Avoid MemoryToPipeRemainder(PtrT in_ptr, size_t full_count,\u000A                           size_t remainder_count) {\u000A  static_assert(fpga_tools::is_sycl_pipe_v<Pipe>);\u000A  using PipeT = decltype(Pipe::read());\u000A  static_assert(fpga_tools::has_subscript_v<PipeT>);\u000A  static_assert(fpga_tools::has_subscript_v<PtrT>);\u000A  static_assert(PipeT::size == elements_per_cycle);\u000A  static_assert(pipe_and_pointer_have_same_base_v<PipeT, PtrT>);\u000A\u000A  for (size_t i = 0; i < full_count; i++) {\u000A    PipeT pipe_data;\u000A#pragma unroll\u000A    for (int j = 0; j < elements_per_cycle; j++) {\u000A      pipe_data[j] = in_ptr[i * elements_per_cycle + j];\u000A    }\u000A    Pipe::write(pipe_data);\u000A  }\u000A\u000A  PipeT pipe_data;\u000A  for (size_t i = 0; i < remainder_count; i++) {\u000A    pipe_data[i] = in_ptr[full_count * elements_per_cycle + i];\u000A  }\u000A  Pipe::write(pipe_data);\u000A}\u000A\u000A//\u000A// Streams data from 'in_ptr' into 'Pipe', 'elements_per_cycle' elements at a\u000A// time with the guarantee that 'elements_per_cycle' is a multiple of 'count'\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, typename PtrT>\u000Avoid MemoryToPipeNoRemainder(PtrT in_ptr, size_t count) {\u000A  static_assert(fpga_tools::is_sycl_pipe_v<Pipe>);\u000A  using PipeT = decltype(Pipe::read());\u000A  static_assert(fpga_tools::has_subscript_v<PipeT>);\u000A  static_assert(fpga_tools::has_subscript_v<PtrT>);\u000A  static_assert(PipeT::size == elements_per_cycle);\u000A  static_assert(pipe_and_pointer_have_same_base_v<PipeT, PtrT>);\u000A\u000A  for (size_t i = 0; i < count; i++) {\u000A    PipeT pipe_data;\u000A#pragma unroll\u000A    for (int j = 0; j < elements_per_cycle; j++) {\u000A      pipe_data[j] = in_ptr[i * elements_per_cycle + j];\u000A    }\u000A    Pipe::write(pipe_data);\u000A  }\u000A}\u000A\u000A//\u000A// Streams data from 'Pipe' to 'out_ptr', 'elements_per_cycle' elements at a\u000A// time\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, typename PtrT>\u000Avoid PipeToMemoryRemainder(PtrT out_ptr, size_t full_count,\u000A                           size_t remainder_count) {\u000A  static_assert(fpga_tools::is_sycl_pipe_v<Pipe>);\u000A  using PipeT = decltype(Pipe::read());\u000A  static_assert(fpga_tools::has_subscript_v<PipeT>);\u000A  static_assert(fpga_tools::has_subscript_v<PtrT>);\u000A  static_assert(PipeT::size == elements_per_cycle);\u000A  static_assert(pipe_and_pointer_have_same_base_v<PipeT, PtrT>);\u000A\u000A  for (size_t i = 0; i < full_count; i++) {\u000A    auto pipe_data = Pipe::read();\u000A#pragma unroll\u000A    for (int j = 0; j < elements_per_cycle; j++) {\u000A      out_ptr[i * elements_per_cycle + j] = pipe_data[j];\u000A    }\u000A  }\u000A\u000A  auto pipe_data = Pipe::read();\u000A  for (size_t i = 0; i < remainder_count; i++) {\u000A    out_ptr[full_count * elements_per_cycle + i] = pipe_data[i];\u000A  }\u000A}\u000A\u000A//\u000A// Streams data from 'Pipe' to 'out_ptr', 'elements_per_cycle' elements at a\u000A// time with the guarantee that 'elements_per_cycle' is a multiple of 'count'\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, typename PtrT>\u000Avoid PipeToMemoryNoRemainder(PtrT out_ptr, size_t count) {\u000A  static_assert(fpga_tools::is_sycl_pipe_v<Pipe>);\u000A  using PipeT = decltype(Pipe::read());\u000A  static_assert(fpga_tools::has_subscript_v<PipeT>);\u000A  static_assert(fpga_tools::has_subscript_v<PtrT>);\u000A  static_assert(PipeT::size == elements_per_cycle);\u000A  static_assert(pipe_and_pointer_have_same_base_v<PipeT, PtrT>);\u000A\u000A  for (size_t i = 0; i < count; i++) {\u000A    auto pipe_data = Pipe::read();\u000A#pragma unroll\u000A    for (int j = 0; j < elements_per_cycle; j++) {\u000A      out_ptr[i * elements_per_cycle + j] = pipe_data[j];\u000A    }\u000A  }\u000A}\u000A\u000A}  // namespace detail\u000A\u000A//\u000A// Streams data from memory to a SYCL pipe 1 element a time\u000A//\u000Atemplate <typename Pipe, typename PtrT>\u000Avoid MemoryToPipe(PtrT in_ptr, size_t count) {\u000A  static_assert(fpga_tools::is_sycl_pipe_v<Pipe>);\u000A  using PipeT = decltype(Pipe::read());\u000A  static_assert(fpga_tools::has_subscript_v<PtrT>);\u000A  static_assert(detail::pipe_and_pointer_have_same_base_v<PipeT, PtrT>);\u000A\u000A  for (size_t i = 0; i < count; i++) {\u000A    Pipe::write(in_ptr[i]);\u000A  }\u000A}\u000A\u000A//\u000A// Streams data from memory to a SYCL pipe 'elements_per_cycle' elements a time\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, bool remainder, typename PtrT>\u000Avoid MemoryToPipe(PtrT in_ptr, size_t count) {\u000A  if constexpr (!remainder) {\u000A    // user promises there is not remainder\u000A    detail::MemoryToPipeNoRemainder<Pipe, elements_per_cycle>(in_ptr, count);\u000A  } else {\u000A    // might have a remainder and it was not specified, so calculate it\u000A    auto full_count = (count / elements_per_cycle) * elements_per_cycle;\u000A    auto remainder_count = count % elements_per_cycle;\u000A    detail::MemoryToPipeRemainder<Pipe, elements_per_cycle>(in_ptr, full_count,\u000A                                                            remainder_count);\u000A  }\u000A}\u000A\u000A//\u000A// Streams data from memory to a SYCL pipe 'elements_per_cycle' elements a time\u000A// In this version, the user has specified a the amount of remainder\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, bool remainder, typename PtrT>\u000Avoid MemoryToPipe(PtrT in_ptr, size_t full_count, size_t remainder_count) {\u000A  if constexpr (!remainder) {\u000A    // user promises there is not remainder\u000A    detail::MemoryToPipeNoRemainder<Pipe, elements_per_cycle>(in_ptr,\u000A                                                              full_count);\u000A  } else {\u000A    // might have a remainder that was specified by the user\u000A    detail::MemoryToPipeRemainder<Pipe, elements_per_cycle>(in_ptr, full_count,\u000A                                                            remainder_count);\u000A  }\u000A}\u000A\u000A//\u000A// Streams data from a SYCL pipe to memory 1 element a time\u000A//\u000Atemplate <typename Pipe, typename PtrT>\u000Avoid PipeToMemory(PtrT out_ptr, size_t count) {\u000A  using PipeT = decltype(Pipe::read());\u000A  static_assert(fpga_tools::has_subscript_v<PtrT>);\u000A  static_assert(detail::pipe_and_pointer_have_same_base_v<PipeT, PtrT>);\u000A\u000A  for (size_t i = 0; i < count; i++) {\u000A    out_ptr[i] = Pipe::read();\u000A  }\u000A}\u000A\u000A//\u000A// Streams data from a SYCL pipe to memory 'elements_per_cycle' elements a time\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, bool remainder, typename PtrT>\u000Avoid PipeToMemory(PtrT out_ptr, size_t count) {\u000A  if constexpr (!remainder) {\u000A    detail::PipeToMemoryNoRemainder<Pipe, elements_per_cycle>(out_ptr, count);\u000A  } else {\u000A    auto full_count = (count / elements_per_cycle) * elements_per_cycle;\u000A    auto remainder_count = count % elements_per_cycle;\u000A    detail::PipeToMemoryRemainder<Pipe, elements_per_cycle>(out_ptr, full_count,\u000A                                                            remainder_count);\u000A  }\u000A}\u000A\u000A//\u000A// Streams data from a SYCL pipe to memory 'elements_per_cycle' elements a time\u000A// In this version, the user has specified a the amount of remainder\u000A//\u000Atemplate <typename Pipe, int elements_per_cycle, bool remainder, typename PtrT>\u000Avoid PipeToMemory(PtrT out_ptr, size_t full_count, size_t remainder_count) {\u000A  if constexpr (!remainder) {\u000A    detail::PipeToMemoryNoRemainder<Pipe, elements_per_cycle>(out_ptr,\u000A                                                              full_count);\u000A  } else {\u000A    detail::PipeToMemoryRemainder<Pipe, elements_per_cycle>(out_ptr, full_count,\u000A                                                            remainder_count);\u000A  }\u000A}\u000A\u000A\u000A/// 1. Allocate device_memory (same num bytes as in host_vector)\u000A/// 2. Transfer data host_vector->device_memory\u000A/// 3. Return sycl::device_ptr to device_memory\u000Atemplate<typename T>\u000AT* toDevice(const std::vector<T> &host_vector, sycl::queue &q) {\u000A  T* device_data = sycl::malloc_device<T>(host_vector.size(), q);\u000A  q.copy(host_vector.data(), device_data, host_vector.size()).wait();\u000A  return device_data;\u000A}\u000Atemplate<typename T, int N>\u000AT* toDevice(const T* host_array[N], sycl::queue &q) {\u000A  T* device_data = sycl::malloc_device<T>(N, q);\u000A  q.copy(host_array, device_data, N).wait();\u000A  return device_data;\u000A}\u000Atemplate<typename T>\u000AT* toDevice(const T* host_array, const int N, sycl::queue &q) {\u000A  T* device_data = sycl::malloc_device<T>(N, q);\u000A  q.copy(host_array, device_data, N).wait();\u000A  return device_data;\u000A}\u000A\u000A}  // namespace fpga_tools\u000A\u000A#endif /* __MEMORY_UTILS_HPP__ */"}, {"path":"/home/u119070/cgo/elastic-sycl-hls/include_sycl/metaprogramming_utils.hpp", "name":"metaprogramming_utils.hpp", "has_active_debug_locs":false, "absName":"/home/u119070/cgo/elastic-sycl-hls/include_sycl/metaprogramming_utils.hpp", "content":"#ifndef __METAPROGRAMMING_UTILS_HPP__\u000A#define __METAPROGRAMMING_UTILS_HPP__\u000A\u000A#include <type_traits>\u000A#include <utility>\u000A\u000A#include <sycl/ext/intel/fpga_extensions.hpp>\u000A\u000Anamespace fpga_tools {\u000A\u000A//\u000A// The code below creates the constexprs 'make_integer_range'\u000A// and 'make_index_range' these are akin to 'std::make_integer_sequence'\u000A// and 'std::make_index_sequence', respectively.\u000A// However they allow you to specificy a range and can either increment\u000A// or decrement, rather than a strict increasing sequence\u000A//\u000Atemplate <typename T, typename, T begin, bool increase>\u000Astruct integer_range_impl;\u000A\u000A// incrementing case\u000Atemplate <typename T, T... N, T begin>\u000Astruct integer_range_impl<T, std::integer_sequence<T, N...>, begin, true> {\u000A  using type = std::integer_sequence<T, N + begin...>;\u000A};\u000A\u000A// decrementing case\u000Atemplate <typename T, T... N, T begin>\u000Astruct integer_range_impl<T, std::integer_sequence<T, N...>, begin, false> {\u000A  using type = std::integer_sequence<T, begin - N...>;\u000A};\u000A\u000A// integer_range\u000Atemplate <typename T, T begin, T end>\u000Ausing integer_range = typename integer_range_impl<\u000A    T, std::make_integer_sequence<T, (begin < end) ? end - begin : begin - end>,\u000A    begin, (begin < end)>::type;\u000A\u000A//\u000A// make_integer_range\u000A//\u000A// USAGE:\u000A//    make_integer_range<int,1,10>{} ==> 1,2,...,9\u000A//    make_integer_range<int,10,1>{} ==> 10,9,...,2\u000A//\u000Atemplate <class T, T begin, T end>\u000Ausing make_integer_range = integer_range<T, begin, end>;\u000A\u000A//\u000A// make_index_range\u000A//\u000A// USAGE:\u000A//    make_index_range<1,10>{} ==> 1,2,...,9\u000A//    make_index_range<10,1>{} ==> 10,9,...,2\u000A//\u000Atemplate <std::size_t begin, std::size_t end>\u000Ausing make_index_range = integer_range<std::size_t, begin, end>;\u000A\u000A//\u000A// The code below creates the constexprs 'make_integer_pow2_sequence'\u000A// and 'make_index_pow2_sequence'. These generate the sequence\u000A// 2^0, 2^1, 2^2, ... , 2^(N-1) = 1,2,4,...,2^(N-1)\u000A//\u000Atemplate <typename T, typename>\u000Astruct integer_pow2_sequence_impl;\u000A\u000Atemplate <typename T, T... Pows>\u000Astruct integer_pow2_sequence_impl<T, std::integer_sequence<T, Pows...>> {\u000A  using type = std::integer_sequence<T, (T(1) << Pows)...>;\u000A};\u000A\u000A// integer_pow2_sequence\u000Atemplate <typename T, T N>\u000Ausing integer_pow2_sequence =\u000A    typename integer_pow2_sequence_impl<T,\u000A                                        std::make_integer_sequence<T, N>>::type;\u000A\u000A//\u000A// make_integer_pow2_sequence\u000A//\u000A// USAGE:\u000A//    make_integer_pow2_sequence<int,5>{} ==> 1,2,4,8,16\u000A//\u000Atemplate <class T, T N>\u000Ausing make_integer_pow2_sequence = integer_pow2_sequence<T, N>;\u000A\u000A//\u000A// make_index_pow2_sequence\u000A//\u000A// USAGE:\u000A//    make_index_pow2_sequence<5>{} ==> 1,2,4,8,16\u000A//\u000Atemplate <std::size_t N>\u000Ausing make_index_pow2_sequence = integer_pow2_sequence<std::size_t, N>;\u000A\u000A//\u000A// Checks for existence of subscript operator\u000A//\u000Anamespace detail {\u000Atemplate <typename... >\u000Ausing void_t = void;\u000A\u000Atemplate<class T, typename = void>\u000Astruct has_subscript_impl : std::false_type { };\u000A\u000Atemplate<typename T>\u000Astruct has_subscript_impl<T, void_t<decltype(std::declval<T>()[1])>> \u000A  : std::true_type { };\u000A}  // namespace detail\u000A\u000Atemplate <typename T>\u000Astruct has_subscript {\u000A  static constexpr bool value =\u000A    std::is_same_v<typename detail::has_subscript_impl<T>::type, std::true_type>;\u000A};\u000A\u000Atemplate <typename T>\u000Ainline constexpr bool has_subscript_v = has_subscript<T>::value;\u000A\u000A//\u000A// checks if a type is any instance of SYCL pipe\u000A//\u000Anamespace detail {\u000A\u000Atemplate<typename T>\u000Astruct is_sycl_pipe_impl : std::false_type {};\u000A\u000Atemplate<typename Id, typename T, std::size_t N>\u000Astruct is_sycl_pipe_impl<sycl::ext::intel::pipe<Id, T, N>> : std::true_type {};\u000A\u000A}  // namespace detail\u000A\u000Atemplate <typename T>\u000Astruct is_sycl_pipe {\u000A  static constexpr bool value = detail::is_sycl_pipe_impl<T>{};\u000A};\u000A\u000Atemplate <typename T>\u000Ainline constexpr bool is_sycl_pipe_v = is_sycl_pipe<T>::value;\u000A\u000A} // namespace fpga_tools\u000A\u000A#endif  /* __METAPROGRAMMING_UTILS_HPP__ */"}];
